import { Route } from "react-router-dom"

const ProtectedRoute = ({component: Component, ...props}) => {
    return (
        <Route>
            {() => 
                props.loggedIn ? <Component {...props}/> : console.log('Wrong')
            }
        </Route>
    )
}

export default ProtectedRoute
